INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('39020231-dd29-4482-be63-382bbe4d43d1', '64a5b75701abc46cb32941f6d46a5ac6', 0, 'coronary artery disease , a condition in which your coronary arteries become narrow or even blocked. What are HDL, LDL, and VLDL? HDL, LDL, and VLDL are lipoproteins. They are a combination of fat (lipid) and protein. The lipids need to be attached to the proteins so they can move through the blood. Different types of lipoproteins have different purposes: HDL stands for high-density lipoprotein. It is sometimes called "good" cholesterol because it helps your body get rid of cholesterol. It carries cholesterol from other parts of your body back to your liver. Your liver then removes the cholesterol from your body. LDL stands for low-density lipoprotein. It is sometimes called "bad" cholesterol because a high LDL level leads to the buildup of plaque in your arteries.', '[0.5735518932342529,0.46047288179397583,0.01745683327317238,0.06510436534881592,0.05833388492465019,0.518767237663269,0.33990252017974854,0.49184221029281616,0.1277141571044922,-0.33041509985923767,0.18099622428417206,0.2542993724346161,-0.13875961303710938,-0.2084980010986328,-0.43451446294784546,0.13308434188365936,-0.16524051129817963,-0.6664629578590393,0.12021320313215256,-0.0006548036471940577,-0.14793157577514648,-0.33414945006370544,0.21817795932292938,-0.43867599964141846,0.11556630581617355,0.31536900997161865,-0.5412483215332031,-0.565605878829956,-0.6960889101028442,-0.53969806432724,-0.11727876961231232,0.199013814330101,-0.4861941337585449,-0.036857012659311295,-0.008791802451014519,-0.624151885509491,-0.1073203831911087,0.2720005214214325,-0.015468227677047253,0.5196586847305298,-0.2146844118833542,0.5974310636520386,0.5696236491203308,0.13315436244010925,-0.11578161269426346,-0.46331459283828735,0.054840147495269775,0.858106255531311,0.2612869143486023,0.22831940650939941,-0.8421334624290466,-0.179020